import React from "react";
import { contact_content } from "./content";
import styles from "./Contact.module.scss";

const Contact = () => {
  return (
    <div id="contact" className={styles.contactWrapper}>
      <div className={styles.leftContent}>
        <div className={styles.textContent}>
          <div className={styles.cardText}>
            <h1>{contact_content.right_content.title}</h1>
            <h2>{contact_content.right_content.sub_heading}</h2>
          </div>
          <svg
            width="554"
            height="568"
            viewBox="0 0 554 568"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink "
            throwIfNamespace={false}
          >
            <rect
              y="3.40662"
              width="550"
              height="564.171"
              transform="rotate(-0.354882 0 3.40662)"
              fill="url(#pattern0)"
            />
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlinkHref="#image0_270_69"
                  transform="matrix(0.00227948 0 0 0.00222222 -0.0128825 0)"
                  throwIfNamespace={false}
                />
              </pattern>
              <image
                id="image0_270_69"
                width="450"
                height="450"
                throwIfNamespace={false}
                xlinkHref="data:image/png;base64,"
              />
            </defs>
          </svg>
        </div>
        <div className={styles.wave}>
          <svg
            width="261"
            height="1023"
            viewBox="0 0 261 1023"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              d="M0 1023V390.5V0H153.449L80.1496 231.5L49.3325 337.813C17.1503 448.835 18.1948 566.852 52.3369 677.288C70.7627 736.887 98.4986 793.198 134.517 844.133L261 1023H80.1496H0Z"
              fill="#DB752B"
            />
          </svg>
        </div>
      </div>
      <div className={styles.rightContent}>
        <label>{contact_content.left_content.first_input.label}</label>
        <input
          type="text"
          placeholder={`${contact_content.left_content.first_input.placeholder}`}
          onChange={() => {}}
        />
        <label>{contact_content.left_content.second_input.label}</label>

        <input
          type="text"
          placeholder={`${contact_content.left_content.second_input.placeholder}`}
          onChange={() => {}}
        />
        <label>{contact_content.left_content.third_input.label}</label>
        <textarea
          placeholder={`${contact_content.left_content.third_input.placeholder}`}
        ></textarea>
        <div className={styles.buttonWrapper}>
          <button className={styles.button}>{contact_content.left_content.button_text}</button>
        </div>
      </div>
    </div>
  );
};

export default Contact;
